import axios from 'axios';
import { useState } from 'react'

const LoginCustomer = () => {
	const [username, setUsername] = useState('')
    const [password, setPassword] = useState('')


	const onClickSave = async () =>
	{
		const res = await axios.get(`http://localhost:8080/foodpanda/customer`, {username : username,password : password}).catch(function (error) {
			if (error.response) {
			  // Request made and server responded
			  console.log(error.response.data);
			  console.log(error.response.status);
			  console.log(error.response.headers);
			} else if (error.request) {
			  // The request was made but no response was received
			  console.log(error.request);
			} else {
			  // Something happened in setting up the request that triggered an Error
			  console.log('Error', error.message);
			}
		})
        const data = await res.json()
		console.log(data)


		
	};
    return (
		<div className='container'>
		<h1>Welcome to DocApp!</h1>
		<form className="add-form">
			<div className="form-control">
				<label> Email </label>
				<input  type="text"
						placeholder="Enter email" value={username} onChange={(e) => setUsername(e.target.value)} />
			</div>
			<div className="form-control">
				<label> Password </label>
				<input type="password" placeholder="Enter password" value={password} onChange={(e) => setPassword(e.target.value)}/>
			</div>
			</form>
				<div>
				
		      	<button onClick={(e) => onClickSave(e)} class="btn btn-primary btn-block" type="submit">Save</button>
				
				</div>
      </div>
    )
};



export default LoginCustomer
